function drawToBubble(cns, lh, rw, text, h, src, t){
	var canvas=document.querySelector("#bubbleCanvas");
	canvas.setAttribute("height",h);
	var cns = document.getElementById(cns);
	var ctx = cns.getContext("2d");
	var lineheight = lh;
	var text = text;

	ctx.width = cns.width;
	ctx.height = cns.height;

	ctx.clearRect(0, 0, ctx.width, ctx.height);
	var img=new Image();
	img.src= src;
	ctx.drawImage(img,0,0);	
	ctx.globalCompositeOperation="source-over";	
	ctx.font = "14px 宋体";
	ctx.fillStyle = "#000";
	function getTrueLength(str){
		var len = str.length, truelen = 0;
		for(var x = 0; x < len; x++){
			if(str.charCodeAt(x) > 128){
				truelen += 2;
			}else{
				truelen += 1;
			}
		}
		return truelen;
	}
	function cutString(str, leng){
		var len = str.length, tlen = len, nlen = 0;
		for(var x = 0; x < len; x++){
			if(str.charCodeAt(x) > 128){
				if(nlen + 2 < leng){
					nlen += 2;
				}else{
					tlen = x;
					break;
				}
			}else{
				if(nlen + 1 < leng){
					nlen += 1;
				}else{
					tlen = x;
					break;
				}
			}
		}
		return tlen;
	}
	function  draw(){
		var row=0;
		for(var i = 1; getTrueLength(text) > 0; i++){
			var tl = cutString(text, rw);
			row=row+tl/tl;
			ctx.fillText(text.substr(0, tl).replace(/^\s+|\s+$/, ""), 63, i * lineheight + t);
			text = text.substr(tl);
		}
		return row;
		
	}
	return draw();
}
				
function select(key){
	var size = drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 101, IMG01, 30);
	switch(size){
		case 1:
			if(key == 1010001){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 101, IMG01, 30);}
			else if(key == 1010002){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 126, IMG11, 70);}
			else if(key == 1010003){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 100, IMG21, 30);}
			else if(key == 1010004){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 109, IMG31, 20);}
			else if(key == 1010005){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 127, IMG41, 70);}
			break;
		case 2:
			if(key == 1010001){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 116, IMG02, 30);}
			else if(key == 1010002){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 139, IMG12, 70);}
			else if(key == 1010003){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 114, IMG22, 30);}
			else if(key == 1010004){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 109, IMG31, 20);}
			else if(key == 1010005){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 141, IMG42, 70);}
			break;
		default:
			if(key == 1010001){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 136, IMG03, 30);}
			else if(key == 1010002){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 159, IMG13, 70);}
			else if(key == 1010003){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 134, IMG23, 30);}
			else if(key == 1010004){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 124, IMG32, 30);}
			else if(key == 1010005){drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 161, IMG43, 70);}
	}
}

var flashJS = "http://static.tieba.baidu.com/tb/static-frs/component/sign_shai/flash_image_loader.js";
if(!unsafeWindow.FlashImageLoader){$.getScript(flashJS)}

function upload(b){
	$.getJSON("/dc/common/imgtbs",function(json){
		unsafeWindow.FlashImageLoader.bind('uploadComplete',complete);
		unsafeWindow.FlashImageLoader.uploadBase64('http://upload.tieba.baidu.com/upload/pic',b.replace(/^.*?base64,/,''),{tbs:json.data.tbs})	
	});	
}

function complete(a, d){
	var json = JSON.parse(d);
	if (json.error_code) {
		$(".j_props_buy_tipper").html('<span><b style="color:red">似乎遇到一点错误，请稍后再试。</b></span>');
	}
	else {
		var hash = json.info.pic_id_encode;
		var url = 'http://imgsrc.baidu.com/forum/pic/item/' + hash + '.jpg'; 
		$(".j_btn_cancel").click();
		$("#ueditor_replace").html('<img class="BDE_Image" src="' + url + '" pic_type="0" onload="EditorUI.resizeImage(this,560)">');
	}
}

function colorfulText(){
	post = '';
	$(".props_container .post_submit").click(function(){	
		var url="http://static.tieba.baidu.com/tb/fonts/";
		$("#props_content_wrap img").each(function() {
			var  width = $(this).width();
			var  height = $(this).height();
			var  src = $(this).attr("src");
			src=url+src.split("/")[5]+'/'+src.split("/")[6];
			post = post + '<img width=' + width + ' height=' + height + ' onload="EditorUI.resizeImage(this, 560)" pic_type="1" src="'+src+'" class="BDE_Image">'
		});	
		$("#ueditor_replace").html(post);
		$(".j_btn_cancel").click();
		$(".poster_submit").click();
	});
}

var target = document.body;
var MutationObserver = window.MutationObserver || window.WebKitMutationObserver || window.MozMutationObserver;
var observer = new MutationObserver(function(mutations) {
    mutations.forEach(function(mutation) {
        if($("#postbubble").length && !$("#props_wrap").length){
			$("#props_container").append('<div id="props_wrap"></div>')
			$("#props_wrap").html('<canvas id="bubbleCanvas" width="557"></canvas><br><textarea id="input" row="6" col="60" style="width:557px;height: 60px;">在这里输入文字,喵~</textarea>');
			$(".j_props_buy_tipper").html('切换效果，请<b style="color:red;font-size:20px;">双击</b>下面各个效果。');
			$(".slide_item").click(function(){
				var key = $(this).data("key");
				select(key);
			})			
			drawToBubble("bubbleCanvas", 19, 60, $("#input").val(), 101, IMG01, 30);
			document.querySelector("#input").onkeyup = function(){
				select($(".slide_item_active").data("key"));
			}
			$(".props_container .post_submit").click(function(){			
				BASE64 = document.querySelector("#bubbleCanvas").toDataURL();
				$(".tb_poster_placeholder").hide();
				upload(BASE64);
			})			
        }
		if($(".dialogJtxt").html()=="炫彩文字"){
			colorfulText();
		}
    });    
});
var config = { attributes: true, childList: true, characterData: true };
observer.observe(target, config);